import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Avatar, Typography } from '@material-ui/core';

import { Parallax } from 'react-parallax';

const useStyles = makeStyles({
    skyliner: {
        width: '100%',
        height: '40vh',
        display: 'flex',
        alignItems: 'flex-end',
    },
    profileAvatar: {
        width: 120,
        height: 120,
    },
    username: {
        color: 'white',
    },
})

function Skyliner(props) {

    const classes = useStyles();

    return (
        <Fragment>
            <Parallax
                bgImage={require('./imgs/nasa.jpg')}
                bgImageAlt="Skyliner"
                strength={200}
            >
                <div className={classes.skyliner}>
                    <Avatar src='/imgs/avatar.jpg' className={classes.profileAvatar} />
                    <Typography
                        variant="h2"
                        color="textPrimary"
                        className={classes.username}
                    >
                        {props.user}
                    </Typography>
                </div>
            </Parallax>
        </Fragment>
    );
}


export default Skyliner;
